Descrizione:
Aumenta la forza dei muscoli del bacino e schiena. Migliora la flessibilità delle articolazioni del collo, vertebre toraciche e lombari, il Sacro, muscoli e legamenti. Estensione completa articolazioni delle spalle e del bacino.

Al dispositivo, e prendendo gli archi, allungare il back up estensione dei muscoli addominali e lombari. L'esercizio può essere fatto anche volto al dispositivo.

